def bingo(card, numbers):
    for i in range(3):
        if card[i][0] in numbers and card[i][1] in numbers and card[i][2] in numbers:
            return True
        if card[0][i] in numbers and card[1][i] in numbers and card[2][i] in numbers:
            return True
    if card[0][0] in numbers and card[1][1] in numbers and card[2][2] in numbers:
        return True
    if card[0][2] in numbers and card[1][1] in numbers and card[2][0] in numbers:
        return True
    return False

