import sys

def main():
    # Read in the input
    bingo_card = []
    for i in range(3):
        bingo_card.append(list(map(int, sys.stdin.readline().split())))
    bingo_nums = []
    N = int(sys.stdin.readline())
    for i in range(N):
        bingo_nums.append(int(sys.stdin.readline()))

    # Check if we have a bingo
    bingo = False
    for i in range(3):
        # Check the rows
        if bingo_card[i][0] in bingo_nums and bingo_card[i][1] in bingo_nums and bingo_card[i][2] in bingo_nums:
            bingo = True
            break
        # Check the columns
        if bingo_card[0][i] in bingo_nums and bingo_card[1][i] in bingo_nums and bingo_card[2][i] in bingo_nums:
            bingo = True
            break
    # Check the diagonals
    if bingo_card[0][0] in bingo_nums and bingo_card[1][1] in bingo_nums and bingo_card[2][2] in bingo_nums:
        bingo = True
    if bingo_card[0][2] in bingo_nums and bingo_card[1][1] in bingo_nums and bingo_card[2][0] in bingo_nums:
        bingo = True

    # Print the output
    if bingo:
        print("Yes")
    else:
        print("No")

